class Solution:
    def updateMatrix(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: List[List[int]]
        """
        def bfs(nodes):
            directions = [[1,0],[-1,0],[0,1],[0,-1]]
            while nodes:
                stack, nodes= nodes[:],[]
                for i,j in stack:
                    for direction in directions:
                        if 0 <= i + direction[0] < m and 0 <= j + direction[1] < n:
                            if matrix[i + direction[0]][j + direction[1]]:
                                nodes.append([i + direction[0], j + direction[1]])
                            else:
                                return self.distance
                self.distance += 1
        m, n = len(matrix), len(matrix[0])
        res =  [[0 for __ in range(n)] for _ in range(m)]
        for i in range(m):
            for j in range(n):
                if matrix[i][j]:
                    nodes = [[i,j]]
                    self.distance = 1
                    res[i][j] = bfs(nodes)
        return res

